import React from "react";
import { Body, ButtonsMenu, HeaderMenu, Logo, Menu } from "./styled";
import lnd from '../../../assets/img/LND_1.png'

const HomePage = () => {


    return(
        <Body>
            <HeaderMenu>
                <Logo src={lnd}/>
                <ButtonsMenu></ButtonsMenu>
                <ButtonsMenu></ButtonsMenu>
                <ButtonsMenu></ButtonsMenu>
            </HeaderMenu>
        </Body>
    )
}

export default HomePage;
